export default (function(a,b,c,d,e,f,g,h,i,j,k,l){return {data:{NTfJZl29iS:{data:{id:1961,attributes:{imdbId:"tt0073190",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMWY5NGRkNTYtMWE2MC00NzdlLWEzNTAtNzY3NzUxMjYyMDg3XkEyXkFqcGdeQXVyNzc5MjA3OA@@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"4.6\u002F10"}],item_lang:{data:{id:2624,attributes:{title:e,plot:"January Wayne, the sheltered, much-loved daughter of a formerly successful Hollywood producer, goes home to New York after a lengthy stint in a Swiss hospital. Mike Wayne has fallen on hard times and decides to marry for money. January is an innocent young woman who searches for her place in the world. Pursued by her rich new stepmother's playboy of a cousin, she instead falls hard for a much older man, a Pulitzer Prize-winning writer who's a surrogate for her father, before tragedy strikes.",slug:"once-is-not-enough"}}},books:{data:[{id:9846,attributes:{title:e,description:f,thumbnail:g,authors:[a],firstBook:true,published:h,publisher:b,subtitle:c}},{id:9847,attributes:{title:e,description:f,thumbnail:g,authors:[a],firstBook:d,published:h,publisher:b,subtitle:c}},{id:9848,attributes:{title:i,description:j,thumbnail:k,authors:[a],firstBook:d,published:l,publisher:b,subtitle:c}},{id:9849,attributes:{title:"Jacqueline Susann Omnibus",description:"THE LOVE MACHINE In a time when steak, vodka and sleeping pills were the staples of a healthy diet and when movie stars wore wigs to bed, the TV set was known as 'the love machine', creating dreams, promising fame, bringing success. But for supermodel Amanda, socialite Judith and journalist Maggie, 'the love machine' meant something else - Robin Stone, brilliant, dynamic, magnetic... ONCE IS NOT ENOUGH Once upon a time, the entertainment industry was a place that never slept, as magazine editors, models and pop stars visited 'vitamin doctors' for the shots that would allow them to work all day and play all night. In this world, January Wayne goes from poor-little-rich-girl to grown-up swinger, as she searches New York and Los Angeles for a guy like Mike Wayne, the glamorous movie producer who also happens to be her father...",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ryIwHgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:d,published:"2004-04-01",publisher:"Sphere",subtitle:"The Love Machine; Once Is Not Enough"}},{id:9850,attributes:{title:i,description:j,thumbnail:k,authors:[a],firstBook:d,published:l,publisher:b,subtitle:c}}]}}},meta:{}}},prerenderedAt:1680940950523}}("Jacqueline Susann","Tiger LLC","",null,"Once Is Not Enough","The spectacular bestseller from the author of VALLEY OF THE DOLLS. Once upon a time, the entertainment industry was a world that never slept. Magazine editors, models, pop stars and all the rest visited “vitamin doctors” to get the shots that would allow them to stay up all night and then work all day—in offices decorated with beanbag chairs and Calderesque mobiles… In this world, January Wayne goes from poor-little-rich-girl to grown-up swinger, as she searches New York and Los Angeles for a guy just like Mike Wayne, the glamorous movie producer, who also happens to be her father… “SPECTACULARLY SUCCESSFUL. There are plane crashes, drug orgies, motorcycle accidents, mass rapes, attempted abortions, suicide, evil doctors and other assorted activities; and I couldn’t put the damned thing down.” —Library Journal “[Susann’s] pulp poetry resonates to this day. WITH HER FORMULA OF SEX, DRUGS, AND SHOW BUSINESS, Susann didn’t so much capture the tenor of her times as she did predict the Zeitgeist of ours.”—Detour","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ChnSCgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2015-11-02","The Love Machine","The spectacular bestseller from the author of VALLEY OF THE DOLLS. In a time when steak, vodka, and Benzedrine were the three main staples of a healthy diet, when high-powered executives called each other “baby” and movie stars wore wigs to bed, network tycoons had a name for the TV set: they called it “the love machine.” But to supermodel Amanda, socialite Judith and journalist Maggie, “the love machine” meant something else: Robin Stone, “a TV-network titan around whom women flutter like so many moths…The novel deals with his rise and fall as he makes the international sex scene (orgying in London, transvestiting in Hamburg), drinks unlimited quantities and checks out the latest Nielsens.”—Newsweek “I READ IT IN ONE GREEDY GULP, ENJOYING EVERY MINUTE.”—Liz Smith “[Susann’s] pulp poetry resonates to this day. WITH HER FORMULA OF SEX, DRUGS, AND SHOW BUSINESS, Susann didn’t so much capture the tenor of her times as she did predict the Zeitgeist of ours.”—Detour","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Q9LYCgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2015-11-01"))